'use strict';

const Order = require('../../contract/lib/order');
const Connector = require('../../gateway/hyperledger-connector');

async function main() {
    const connector = new Connector();
    const contract = await connector.getContractInstance('../identity/user/peter/wallet', 'User1@customer.com');
    console.log('Submit create order transaction.');
    let successfulCreations = 0;
    const startTime = Date.now();
    const start = 1;
    const numberOfOrders = 1;
    const includePayload = false;
    for (let i = start; i < start + numberOfOrders; i++) {
        const id = `${i}`;
        console.log(`Creating order with ID: ${id}`);

        contract.submitTransaction('createOrder', 'Peter', id, '5', '2019-07-26', '2', includePayload ? PAYLOAD : '')
            .then(async (issueResponse) => {
                // process response
                console.log('Process issue transaction response.');
                let order = Order.fromBuffer(issueResponse);
                console.log(`${order.customer} created Order: ${order.orderNumber} in quantity: ${order.quantity}`);
                console.log('Transaction complete.');
                ++successfulCreations;
                if (successfulCreations === numberOfOrders) {
                    const endTime = Date.now();
                    console.log(`All ${numberOfOrders} created in ${endTime - startTime} ms`);
                    console.log('Disconnect from Fabric gateway.');
                    await connector.disconnect();
                }
            })
            .catch(error => {
                console.log(`Error processing transaction. ${error}`);
                console.log(error.stack);
            });
    }
    // Disconnect from the gateway
    setTimeout(async () => {
        console.log('Disconnect from Fabric gateway.');
        await connector.disconnect();
    }, 180000);
}

main().then(() => {
    console.log('Create order program complete.');
}).catch((e) => {
    console.log('Create order program exception.');
    console.log(e);
    console.log(e.stack);
    process.exit(-1);
});

